/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap, unsafeHTML, setTags, setSuffix } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<ui5-responsive-popover vertical-align="Top"><ui5-list mode="None" @ui5-item-click="${ifDefined(context.handleListItemClick)}"><ui5-li ?selected="${context._popoverContent.mainItemSelected}" .associatedItem="${ifDefined(context._popoverContent.mainItem)}">${ifDefined(context._popoverContent.mainItem.text)}</ui5-li>${ repeat(context._popoverContent.subItems, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</ui5-list></ui5-responsive-popover>`; };
const block1 = (item, index, context) => { return html`<ui5-li ?selected="${item.selected}" .associatedItem="${ifDefined(item)}">${ifDefined(item.text)}</ui5-li>`; };


const main = (context, tags, suffix) => {
	setTags(tags);
	setSuffix(suffix);
	return block0(context);
};

export default main;
